import Vue from "vue";
import VueRouter from "vue-router";
Vue.use(VueRouter);
import home from "../components/home.vue";
import computed from "../views/home/computed.vue";
import dataBase from "../views/home/dataBase.vue";
import enter from "../views/home/enter.vue";
import lowCarbon from "../views/home/lowCarbon.vue";
import New from "../views/home/new.vue";
import policy from "../views/home/policy.vue";
import search from "../views/home/search.vue";
import zeroCarbon from "../views/home/zeroCarbon.vue";
const routes = [{
        path: "/",
        component: search,
    },{
		path: "/computed",
		component: computed,
	},
	{
		path: "/dataBase",
		component: dataBase,
	},
	{
		path: "/enter",
		component: enter,
	},
	{
		path: "/lowCarbon",
		component: lowCarbon,
	},
	{
		path: "/new",
		component: New,
	},
	{
		path: "/policy",
		component: policy,
	},
	{
		path: "/zeroCarbon",
		component: zeroCarbon,
	}
];

const router = new VueRouter({
    mode: "history",
    base: process.env.BASE_URL,
    routes,
});

export default router;
